import React from "react";

import { motion } from "framer";

const Header = () => {
  return (
    <div className="Header">
      <motion.h1
        style={{ width: "90vw", fontFamily: "Roboto" }}
        initial={{ x: "120vw", display: "none" }}
        animate={{ x: "0vw", display: "block" }}
        transition={{ duration: 5 }}
      >
        Hello
      </motion.h1>
      <motion.h1
        style={{ width: "90vw", fontFamily: "Roboto" }}
        initial={{ x: "120vw", display: "none" }}
        animate={{ x: "0vw", display: "block" }}
        transition={{ duration: 5 }}
      >
        My name is Manuel
      </motion.h1>
      <motion.h1
        style={{ width: "90vw", fontFamily: "Roboto" }}
        initial={{ x: "120vw", display: "none" }}
        animate={{ x: "0vw", display: "block" }}
        transition={{ duration: 5 }}
      >
        Web Developer
      </motion.h1>
    </div>
  );
};

export default Header;
